import React from 'react'
import data from '../data.json' ;


 function Product() {
  return (
    <div>
        {data.map((datum) =>{
            return(
                <div key={datum.id}>
                    <h1> {datum.name}</h1>
                </div>
            )

        })}
    </div>
  )
}

export default Product ;
